import React, {Component} from 'react';

import './Blog.css';

class Blog extends Component {
    return(){
        render(
            <div>
            <section className="Posts">
                <Post />
                <Post />
                <Post />
            </section>
            <section>
                <FullPost />
            </section>
            <section>
                <NewPost />
            </section>
        </div>
        );
    }
}
